import React, { Component } from "react";
import fire from "./database";
export default class Aboutus extends Component {
  componentDidMount() {
    fire.auth().onAuthStateChanged(user => {
      if (user) {
        console.log("user logged");
      } else {
        window.location.href = "./login";
      }
    });
  }
  render() {
    return (
      <div>
        <p>About us</p>
      </div>
    );
  }
}
